	(1, 'Header Center', 'header', '<p>{{company_logo}}</p><h3><b>{{company_name}}</b></h3>', 0, NULL, '2020-10-13 17:43:40', '2020-10-16 04:44:19', NULL, NULL, NULL, NULL),
	(2, 'Header Center', 'header', '<figure class="table"><table><tbody><tr><td style="width:80px;">{company_logo}</td><td><h3><strong>{company_name}</strong></h3><p>{company_address}</p><p>Telp.&nbsp;{company_phone}, Email: {company_email}, Website: {company_website}</p></td></tr></tbody></table></figure><hr><p>&nbsp;</p>', 1, 24, '2020-10-13 17:50:22', '2020-10-17 19:32:53', NULL, 27, NULL, NULL),
	(3, 'Kuitansi', 'receipt', '<h3 style="text-align:center;"><strong><u>KWITANSI</u></strong></h3><figure class="table"><table><tbody><tr><td style="width:50%;"><strong>Nomor:</strong> {trans_no}</td><td style="width:50%;"><p style="text-align:right;"><strong>Tanggal:</strong> {trans_date}</p></td></tr></tbody></table></figure><figure class="table"><table><tbody><tr><td style="width:150px;">Telah dibayar dari</td><td style="width:10px;">:</td><td>{payer}</td></tr><tr><td>Terbilang</td><td>:</td><td>{total_inword}</td></tr><tr><td>Untuk Pembayaran</td><td>:</td><td>{description}</td></tr></tbody></table></figure><p>{detail}&nbsp;</p><figure class="table"><table><tbody><tr><td style="width:50%;"><p>&nbsp;</p><p><strong>Jumlah:</strong> <u>Rp {{total}}</u></p></td><td><p style="text-align:center;"><strong>Jakarta, {{date}}</strong></p><p style="text-align:center;">&nbsp;</p><p style="text-align:center;">&nbsp;</p><p style="text-align:center;">(_________________________)</p></td></tr></tbody></table></figure>', 1, 24, '2020-10-13 21:50:24', '2020-10-22 16:42:54', NULL, 27, NULL, NULL),
	(7, 'Header', 'header', '<figure class="table"><table><tbody><tr><td style="width:90px;">{company_logo}</td><td><h4>{company_name}</h4><p>{company_address}</p><p>Telp. {company_phone}<i>, </i>Fax: {company_fax}<i>,</i> Email: {company_email}</p></td></tr></tbody></table></figure><p>&nbsp;</p><h4>&nbsp;</h4>', 0, 26, '2020-10-16 02:36:45', '2020-10-16 04:44:19', NULL, 27, NULL, NULL),
	(8, 'Voucher', 'voucher', '<p style="text-align:center;">{header}</p><h3 style="text-align:center;"><strong><u>VOUCHER</u></strong></h3><figure class="table"><table><tbody><tr><td style="width:50%;"><strong>Nomor:</strong> {trans_no}</td><td style="width:50%;"><p style="text-align:right;"><strong>Tanggal:</strong> {trans_date}</p></td></tr></tbody></table></figure><figure class="table"><table><tbody><tr><td style="width:150px;">Telah dibayar dari</td><td style="width:10px;">:</td><td>{payer}</td></tr><tr><td>Terbilang</td><td>:</td><td>{total_inword}</td></tr><tr><td>Untuk Pembayaran</td><td>:</td><td>{description}</td></tr></tbody></table></figure><p>{detail}&nbsp;</p><figure class="table"><table><tbody><tr><td>Disetujui oleh:</td><td>Diperiksa oleh:</td><td>Dibayar oleh:</td><td>Diterima oleh:</td></tr><tr><td style="height:80px;">&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td>{approved_by}</td><td>{checked_by}</td><td>{payer}</td><td>{payer}</td></tr></tbody></table></figure><p>{pagenum}</p>', 1, 24, '2020-10-18 08:05:13', '2020-10-18 09:07:37', NULL, 27, NULL, NULL),
